import "./topbar.css"

export default function TopBar() {
  return (
    <div className="top">
        <div className="topLeft"></div>
        <i class="fab fa-facebook-square"></i>
        <div className="topCenter"></div>
        <div className="topRight"></div>
    </div>
  )
}
